int accountBalanceAfterPurchase(int purchaseAmount) {
    // Find the remainder when dividing by 10
    int remainder = purchaseAmount % 10;

    // Round to the nearest multiple of 10
    // If remainder is 5 or more, round up, otherwise round down
    if (remainder >= 5) {
        purchaseAmount += (10 - remainder);
    } else {
        purchaseAmount -= remainder;
    }

    // Subtract the rounded purchase amount from the initial balance of 100 dollars
    return 100 - purchaseAmount;
}
